<body>
    <div class="head">
        <h2 style="margin-top: 8%;">Memmory Game</h2> 
        
        <form name="form">
            {% block content %}
                <div class="datos" style="margin-left: -20%;">
                    <input type="text" name="idAlumno" id="idAlumno" value="{{login_userActual._id |safe}} " style="visibility: hidden;">
                    <input type="text" name="nombre" id="nombre" value="{{login_userActual.nombre |safe}} {{login_userActual.apellido |safe}}" style="margin-left: -40.5%;"  readonly="readonly">

                    <div class="score" style="margin-left: 2%;">Score:<span id="span" style="visibility: hidden;">0</span></div>
                    <input type="text" name="score" id="score" value="0" style="margin-left: 2%; margin-bottom: 20px;" readonly="readonly">
                </div>
            {% endblock content %}  
            <div style="position: relative; margin-left: -20%;">
                <a href="{{url_for('OpcionesJuegos')}}" class="btn btn-primary btn-block" style="margin-left: 60%; margin-top:-200px;">Salir del Juego</a>
                <a href="{{url_for('juegos')}}" class="btn btn-primary btn-block" id="Rcali" style="visibility: visible; margin-top: -130px; margin-left: 60%;">Evaluacion</a>
            </div>
            
            
        </form>
